<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
    
    <meta name="apple-mobile-web-app-capable" content="yes">
    <meta name="apple-mobile-web-app-status-bar-style" content="black-translucent">
    <meta name="apple-mobile-web-app-title" content="CAUDAMAS">
    <meta name="mobile-web-app-capable" content="yes">
    <meta name="theme-color" content="#5e17eb">
    
    <title>CAUDAMAS</title>
    
    <link rel="apple-touch-icon" href="logo.png">
    <link rel="icon" type="image/png" href="logo.png">

    <link rel="manifest" href="data:application/manifest+json,{%22name%22:%22CAUDAMAS%22,%22short_name%22:%22CAUDAMAS%22,%22start_url%22:%22index.html%22,%22display%22:%22standalone%22,%22background_color%22:%22#f3f4f6%22,%22theme_color%22:%22#5e17eb%22,%22icons%22:[{%22src%22:%22logo.png%22,%22sizes%22:%22512x512%22,%22type%22:%22image/png%22}]}">

    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700;900&display=swap" rel="stylesheet">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css">
    <script src="https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.4.1/html2canvas.min.js"></script>

    <style>
        :root {
            --bg: #f3f4f6; --card: #ffffff; --border: #e5e7eb; --text: #111827;
            --text-light: #6b7280; --primary: #5e17eb; --primary-dark: #4c11be;
            --primary-light: #ece9fb; --success: #10b981; --danger: #ef4444; 
            --warning: #f59e0b; --shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.05);
        }
        .tabular { font-variant-numeric: tabular-nums; }
        * { margin:0; padding:0; box-sizing:border-box; font-family:'Inter', sans-serif; -webkit-tap-highlight-color:transparent; }
        body { background: var(--bg); color: var(--text); min-height: 100vh; display: flex; justify-content: center; overflow-x: hidden; }
        .view { width: 100%; max-width: 600px; display: none; flex-direction: column; min-height: 100vh; position: relative; animation: fadeIn 0.3s ease; border-left: 1px solid var(--border); border-right: 1px solid var(--border); background: var(--bg); }
        .view.active { display: flex; }
        @keyframes fadeIn { from { opacity: 0; transform: translateY(10px); } to { opacity: 1; transform: translateY(0); } }
        header { padding: 15px 20px; position: sticky; top: 0; z-index: 50; border-bottom: 1px solid var(--border); display: flex; justify-content: space-between; align-items: center; background: rgba(255, 255, 255, 0.95); backdrop-filter: blur(12px); box-shadow: var(--shadow); }
        .logo-header { height: 32px; width: auto; display: block; }
        .btn { width: 100%; padding: 16px; border: none; border-radius: 12px; font-weight: 700; font-size: 1rem; cursor: pointer; transition: 0.2s; display: flex; align-items: center; justify-content: center; gap: 10px; color: white; box-shadow: var(--shadow); }
        .btn:active { transform: scale(0.98); }
        .btn-primary { background: var(--primary); }
        .btn-success { background: var(--success); color: #fff; }
        .btn-outline { background: #fff; border: 1px solid var(--border); color: var(--text); box-shadow: none; }
        .btn-danger { background: #fee2e2; border: 1px solid #fecaca; color: var(--danger); box-shadow: none; }
        .btn-icon { width: 40px; height: 40px; flex-shrink: 0; border-radius: 10px; border: 1px solid var(--border); background: #fff; color: var(--text-light); display: flex; align-items: center; justify-content: center; transition: 0.2s; }
        .input { width: 100%; padding: 14px; background: #fff; border: 1px solid var(--border); color: var(--text); border-radius: 10px; outline: none; font-size: 1rem; margin-bottom: 15px; transition: 0.3s; }
        .input:focus { border-color: var(--primary); box-shadow: 0 0 0 3px var(--primary-light); }
        .input-label { display: block; font-size: 0.75rem; font-weight: 600; color: var(--text-light); text-transform: uppercase; margin-bottom: 6px; margin-left: 2px; letter-spacing: 0.5px; }
        .fin-card { background: var(--card); border: 1px solid var(--border); padding: 20px; border-radius: 16px; text-align: left; margin-bottom: 15px; box-shadow: var(--shadow); position: relative; overflow: hidden; }
        .fin-label { font-size: 0.75rem; color: var(--text-light); font-weight: 600; text-transform: uppercase; letter-spacing: 0.5px; }
        .fin-value { font-size: 1.8rem; font-weight: 800; color: var(--text); margin-top: 5px; }
        .fin-icon { position: absolute; right: 20px; top: 20px; font-size: 2rem; opacity: 0.1; }
        .item-card { background: var(--card); padding: 12px; border-radius: 12px; border: 1px solid var(--border); margin-bottom: 8px; display: flex; align-items: center; gap: 12px; box-shadow: var(--shadow); }
        .item-card.selected { border-color: var(--primary); background: var(--primary-light); }
        .item-check { width: 24px; height: 24px; flex-shrink: 0; border-radius: 6px; border: 2px solid #d1d5db; display: flex; align-items: center; justify-content: center; cursor: pointer; background: #fff; }
        .item-card.selected .item-check { background: var(--primary); border-color: var(--primary); }
        .item-card.selected .item-check i { display: block; color: white; font-size: 0.7rem; }
        .item-check i { display: none; }
        .item-thumb { width: 48px; height: 48px; border-radius: 8px; overflow: hidden; background: #f3f4f6; flex-shrink: 0; display: flex; align-items: center; justify-content: center; border: 1px solid var(--border); }
        .item-thumb img { width: 100%; height: 100%; object-fit: cover; }
        .prod-grid { display: grid; grid-template-columns: repeat(2, 1fr); gap: 12px; padding: 15px; padding-bottom: 140px; }
        .prod-card { background: var(--card); border: 1px solid var(--border); border-radius: 16px; overflow: hidden; position: relative; cursor: pointer; transition: 0.1s; box-shadow: var(--shadow); }
        .prod-card:active { transform: scale(0.96); border-color: var(--primary); }
        .prod-img { width: 100%; height: 120px; background: #fff; display: flex; align-items: center; justify-content: center; padding: 10px; position: relative; border-bottom: 1px solid var(--border); }
        .prod-img img { max-width: 100%; max-height: 100%; object-fit: contain; }
        .prod-info { padding: 12px; text-align: center; }
        .prod-name { font-size: 0.9rem; font-weight: 600; color: var(--text); line-height: 1.2; }
        .prod-price { color: var(--primary); font-weight: 800; font-size: 1rem; margin-top: 4px; }
        .prod-badge { position: absolute; top: 8px; right: 8px; background: var(--primary); color:white; padding: 4px 8px; border-radius: 6px; font-size: 0.75rem; font-weight: 700; z-index: 5; box-shadow: 0 2px 5px rgba(0,0,0,0.1); }
        .search-container { position: sticky; top: 72px; background: rgba(243, 244, 246, 0.95); backdrop-filter: blur(5px); z-index: 40; padding: 10px 15px; border-bottom: 1px solid var(--border); }
        .search-input { width: 100%; padding: 12px 40px 12px 15px; border-radius: 10px; background: #fff; border: 1px solid var(--border); color: var(--text); outline: none; font-size:0.95rem; box-shadow: var(--shadow); }
        .search-icon { position: absolute; right: 30px; top: 50%; transform: translateY(-50%); color: var(--text-light); }
        .modal { position: fixed; inset: 0; background: rgba(0,0,0,0.5); z-index: 2000; display: none; justify-content: center; align-items: flex-end; backdrop-filter: blur(4px); }
        .sheet { background: #fff; width: 100%; max-width: 600px; border-radius: 24px 24px 0 0; padding: 25px; animation: slideUp 0.3s ease; max-height: 90vh; overflow-y: auto; box-shadow: 0 -10px 40px rgba(0,0,0,0.1); }
        @keyframes slideUp { from { transform: translateY(100%); } to { transform: translateY(0); } }
        .toast { position: fixed; top: 30px; left: 50%; transform: translateX(-50%); background: #1f2937; color: #fff; padding: 12px 25px; border-radius: 50px; font-weight: 600; z-index: 3000; display: none; box-shadow: 0 10px 30px rgba(0,0,0,0.2); font-size: 0.9rem; }
        #ticket-print { position: fixed; left: -9999px; width: 320px; background: white; color: black; padding: 20px; font-family: 'Courier New', monospace; }
    </style>
</head>
<body>

    <div id="toast" class="toast">Notificación</div>
    <div id="loader" style="position:fixed; inset:0; background:#f3f4f6; z-index:4000; display:flex; align-items:center; justify-content:center; flex-direction:column;">
        <div style="width:50px; height:50px; border:4px solid #e5e7eb; border-top-color:var(--primary); border-radius:50%; animation:spin 1s linear infinite;"></div>
    </div>

    <section id="v-login" class="view">
        <div style="padding:60px 30px; text-align:center; flex:1; display:flex; flex-direction:column; justify-content:center;">
            <div style="width:120px; height:120px; margin:0 auto 30px auto; display:flex; align-items:center; justify-content:center;">
                <img id="logo-login" src="" alt="Logo" style="max-width:100%; max-height:100%; display:none;">
                <div id="logo-placeholder" style="font-size:4rem;">⚡</div>
            </div>
            <h1 style="font-size:2rem; margin-bottom:5px; color:var(--primary); font-weight:900;">CAUDAMAS</h1>
            <p style="color:var(--text-light); margin-bottom:40px; letter-spacing:1px; font-size:0.8rem; text-transform:uppercase;">Sistema de Gestión</p>
            <input type="text" id="userInput" class="input" placeholder="Nombre del Usuario" style="text-align:center;">
            <button class="btn btn-primary" onclick="login()">INGRESAR</button>
        </div>
    </section>

    <section id="v-event-dash" class="view">
        <header>
            <img id="logo-header-img" src="" class="logo-header" style="display:none;">
            <div id="logo-text-fallback" style="font-weight:900; color:var(--primary);">CAUDAMAS</div>
            <button class="btn-icon" onclick="logout()" style="color:var(--danger); border-color:#fee2e2;"><i class="fas fa-power-off"></i></button>
        </header>
        <div style="padding:20px;">
            <div class="fin-card" style="background: linear-gradient(135deg, var(--primary), #4f46e5); color:white; border:none;" onclick="calcFinancials()">
                <span class="fin-label" style="color:rgba(255,255,255,0.7);">GANANCIA NETA</span>
                <div id="dashProfit" class="fin-value" style="color:#fff;">$0</div>
            </div>
            <div style="display:grid; grid-template-columns:1fr 1fr; gap:15px; margin-bottom:25px;">
                <div class="fin-card" style="margin:0; padding:15px;"><span class="fin-label">INGRESOS</span><b id="dashRevenue" class="tabular" style="color:var(--success); display:block;">$0</b></div>
                <div class="fin-card" style="margin:0; padding:15px;"><span class="fin-label">GASTOS</span><b id="dashExpenses" class="tabular" style="color:var(--danger); display:block;">$0</b></div>
            </div>
            <button class="btn btn-primary" onclick="showView('v-event-setup')" style="margin-bottom:10px;"><i class="fas fa-cash-register"></i> ABRIR CAJA</button>
            <button class="btn btn-outline" onclick="showView('v-expenses')"><i class="fas fa-exchange-alt"></i> MOVIMIENTOS</button>
            <h4 class="input-label" style="margin-top:30px;">HISTORIAL</h4>
            <div id="evHistList"></div>
        </div>
    </section>

    <section id="v-expenses" class="view">
        <header><button class="btn-icon" onclick="showView('v-event-dash')"><i class="fas fa-chevron-left"></i></button><b>MOVIMIENTOS</b><div style="width:44px;"></div></header>
        <div style="padding:20px;">
            <div class="fin-card"><input type="text" id="expDesc" class="input" placeholder="Descripción"><input type="number" id="expAmount" class="input" placeholder="Monto $">
            <div style="display:grid; grid-template-columns:1fr 1fr; gap:10px;"><button class="btn btn-danger" onclick="addMovement('expense')">GASTO</button><button class="btn btn-success" onclick="addMovement('income')">INGRESO</button></div></div>
            <div id="expensesList"></div>
        </div>
    </section>

    <section id="v-event-setup" class="view">
        <header><button class="btn-icon" onclick="showView('v-event-dash')"><i class="fas fa-chevron-left"></i></button><b>CONFIGURACIÓN</b><div style="width:44px;"></div></header>
        <div style="padding:20px;"><input type="text" id="evName" class="input" placeholder="Evento"><input type="text" id="evBox" class="input" placeholder="Caja"><button class="btn btn-success" onclick="openProdEdit(-1)">NUEVO PRODUCTO</button><div id="evProdList" style="margin-top:20px; margin-bottom:30px;"></div><button class="btn btn-primary" onclick="launchEventPOS()">INICIAR VENTA</button></div>
    </section>

    <section id="v-event-pos" class="view">
        <header><div style="display:flex; flex-direction:column;"><b id="posTitleEv" style="color:var(--primary);">CAJA</b><span id="posSubEv" style="font-size:0.7rem;">Cajero</span></div><div id="posSessionTotal" class="tabular" style="font-weight:900;">$0</div></header>
        <div class="search-container"><input type="search" id="evSearch" class="search-input" placeholder="Buscar..." onkeyup="renderEventPOSGrid(this.value)"></div>
        <div id="evPosGrid" class="prod-grid"></div>
        <div style="position:fixed; bottom:0; left:50%; transform:translateX(-50%); width:100%; max-width:600px; padding:20px; background:rgba(255,255,255,0.9); backdrop-filter:blur(10px); display:flex; gap:10px; border-top:1px solid var(--border);"><button class="btn btn-outline" style="flex:0.4;" onclick="confirmCloseBox()">CERRAR</button><button class="btn btn-primary" style="flex:1;" onclick="openEventCart()">COBRAR <span id="btnEvCartTotal">$0</span></button></div>
    </section>

    <div id="customConfirm" class="modal"><div class="sheet"><h3>Confirmación</h3><p id="confirmMsg" style="margin:15px 0 25px 0;">¿Seguro?</p><div style="display:flex; gap:10px;"><button class="btn btn-outline" style="flex:1;" onclick="closeModal('customConfirm')">NO</button><button class="btn btn-primary" style="flex:1;" id="confirmBtnYes">SI</button></div></div></div>
    <div id="modalCart" class="modal"><div class="sheet"><h3>Pedido</h3><div id="cartList" style="margin:15px 0; max-height:300px; overflow-y:auto;"></div><div style="display:flex; justify-content:space-between; margin-bottom:20px; font-weight:900;"><span>TOTAL</span><span id="cartTotalDisplay">$0</span></div><div style="display:grid; grid-template-columns:1fr 1fr; gap:10px;"><button class="btn btn-success" style="grid-column:span 2;" onclick="payEvent('Efectivo')">EFECTIVO</button><button class="btn" style="background:#3b82f6;" onclick="payEvent('Transferencia')">TRANSF.</button><button class="btn" style="background:#f59e0b;" onclick="payEvent('Debito')">DÉBITO</button></div><button class="btn btn-outline" style="margin-top:10px;" onclick="closeModal('modalCart')">CERRAR</button></div></div>
    <div id="modalEdit" class="modal"><div class="sheet"><h3>Producto</h3><div id="editPrev" style="width:80px; height:80px; background:#eee; margin:15px auto; border-radius:10px; overflow:hidden;"></div><input type="file" id="fileIn" style="display:none;" accept="image/*"><button class="btn btn-outline" style="margin-bottom:10px;" onclick="document.getElementById('fileIn').click()">SUBIR IMAGEN</button><input type="text" id="editName" class="input" placeholder="Nombre"><input type="number" id="editPrice" class="input" placeholder="Precio"><button class="btn btn-primary" onclick="saveProduct()">GUARDAR</button><button class="btn btn-outline" style="margin-top:10px;" onclick="closeModal('modalEdit')">CANCELAR</button></div></div>
    <div id="modalReport" class="modal"><div class="sheet" style="text-align:center;"><i class="fas fa-check-circle" style="font-size:3rem; color:var(--success);"></i><h3>¡Caja Cerrada!</h3><div id="repBody" style="text-align:left; background:#f9fafb; padding:15px; margin:15px 0; border-radius:10px;"></div><button class="btn btn-primary" onclick="downloadTicketImage()">DESCARGAR TICKET</button><button class="btn btn-outline" style="margin-top:10px;" onclick="closeModal('modalReport'); showView('v-event-dash');">VOLVER</button></div></div>

    <div id="ticket-print"><div style="text-align:center; border-bottom:1px solid #000; padding-bottom:5px;"><h2 id="tTitle">TICKET</h2><p id="tSub">INFO</p><p id="tDate">FECHA</p></div><div id="tItems" style="margin:10px 0;"></div><div style="border-top:1px solid #000; padding-top:5px; font-weight:bold; display:flex; justify-content:space-between;"><span>TOTAL</span><span id="tTotal">$0</span></div></div>

        let db = { products: DEFAULT_ITEMS, eventHistory: [], movements: [] }; 
        let app = { user: null, activeSession: null, cart: {} };
        let editId = null, imgTemp = null;
        let currentConfirmCallback = null;

        const getNow = () => new Date().toLocaleString('es-AR', { hour12: false, day:'2-digit', month:'2-digit', hour:'2-digit', minute:'2-digit' });
        function toast(msg) { const t=document.getElementById('toast'); t.innerText=msg; t.style.display='block'; setTimeout(()=>t.style.display='none', 2000); }
        function saveDB() { localStorage.setItem('caudamas_db_v65', JSON.stringify(db)); }
        function saveSession() { if(app.activeSession) localStorage.setItem('caudamas_session_v65', JSON.stringify(app.activeSession)); }
        function clearSession() { app.activeSession = null; localStorage.removeItem('caudamas_session_v65'); }

        function showView(id) {
            document.querySelectorAll('.view').forEach(v => v.classList.remove('active'));
            document.getElementById(id).classList.add('active');
            if(id === 'v-event-dash') { renderEventDash(); calcFinancials(); }
            if(id === 'v-event-setup') renderEventSetup();
            if(id === 'v-expenses') renderMovementsList();
            if(id === 'v-event-pos') { document.getElementById('evSearch').value = ''; renderEventPOSGrid(); }
        }
        function closeModal(id) { document.getElementById(id).style.display='none'; }
        function showConfirm(msg, callback) { document.getElementById('confirmMsg').innerText = msg; currentConfirmCallback = callback; document.getElementById('customConfirm').style.display = 'flex'; }
        document.getElementById('confirmBtnYes').onclick = function() { if(currentConfirmCallback) currentConfirmCallback(); closeModal('customConfirm'); }

        window.onload = () => {
            if(YOUR_LOGO_BASE64) {
                document.getElementById('logo-login').src = YOUR_LOGO_BASE64; document.getElementById('logo-login').style.display='block';
                document.getElementById('logo-placeholder').style.display='none';
                document.getElementById('logo-header-img').src = YOUR_LOGO_BASE64; document.getElementById('logo-header-img').style.display='block';
                document.getElementById('logo-text-fallback').style.display='none';
            }
            const savedDB = localStorage.getItem('caudamas_db_v65');
            if(savedDB) db = JSON.parse(savedDB);
            app.user = localStorage.getItem('caudamas_user_v65');
            const savedSession = localStorage.getItem('caudamas_session_v65');
            document.getElementById('loader').style.display='none';
            if(app.user) {
                if(savedSession) {
                    app.activeSession = JSON.parse(savedSession);
                    document.getElementById('posTitleEv').innerText = app.activeSession.event.toUpperCase();
                    document.getElementById('posSubEv').innerText = `Cajero: ${app.user}`;
                    updateUICommon(); showView('v-event-pos');
                } else showView('v-event-dash');
            } else showView('v-login');
            calcFinancials();
        };

        // LÓGICA V65 PURA (SIN CAMBIOS)
        function login() { const u=document.getElementById('userInput').value; if(!u) return; localStorage.setItem('caudamas_user_v65', u); app.user=u; showView('v-event-dash'); }
        function logout() { localStorage.removeItem('caudamas_user_v65'); location.reload(); }
        function calcFinancials() {
            let sales = 0; db.eventHistory.forEach(h => sales += Number(h.total));
            let inc = 0, exp = 0; db.movements.forEach(m => { if(m.type==='income') inc+=Number(m.amount); else exp+=Number(m.amount); });
            const net = (sales + inc) - exp;
            document.getElementById('dashRevenue').innerText = '$' + (sales + inc);
            document.getElementById('dashExpenses').innerText = '$' + exp;
            document.getElementById('dashProfit').innerText = '$' + net;
        }
        function renderEventDash() {
            const l = document.getElementById('evHistList'); l.innerHTML = '';
            [...db.eventHistory].reverse().forEach(h => {
                l.innerHTML += `<div class="item-card"><div style="flex:1"><b>${h.event}</b><br><small>${h.date}</small></div><div style="text-align:right"><b>$${h.total}</b><br><span onclick="rePrint(${h.id})" style="color:var(--primary); font-size:0.7rem;">VER</span> <span onclick="deleteHist(${h.id})" style="color:var(--danger); font-size:0.7rem;">X</span></div></div>`;
            });
        }
        function addMovement(t) {
            const d=document.getElementById('expDesc').value, a=parseInt(document.getElementById('expAmount').value);
            if(!d || !a) return; db.movements.push({id:Date.now(), type:t, desc:d, amount:a, date:getNow()});
            saveDB(); document.getElementById('expDesc').value=''; document.getElementById('expAmount').value=''; renderMovementsList(); calcFinancials();
        }
        function renderMovementsList() {
            const l = document.getElementById('expensesList'); l.innerHTML = '';
            [...db.movements].reverse().forEach(m => {
                const c = m.type==='income'?'var(--success)':'var(--danger)';
                l.innerHTML += `<div class="item-card"><div style="flex:1"><b>${m.desc}</b><br><small>${m.date}</small></div><div style="text-align:right"><b style="color:${c}">$${m.amount}</b><br><span onclick="delMovement(${m.id})" style="font-size:0.7rem;">BORRAR</span></div></div>`;
            });
        }
        function delMovement(id) { db.movements = db.movements.filter(m=>m.id!==id); saveDB(); renderMovementsList(); calcFinancials(); }
        function renderEventSetup() {
            const l = document.getElementById('evProdList'); l.innerHTML = '';
            db.products.forEach(p => {
                l.innerHTML += `<div class="item-card ${p.selected?'selected':''}"><div class="item-check" onclick="toggleProd(${p.id})"><i class="fas fa-check"></i></div><div style="flex:1" onclick="toggleProd(${p.id})"><b>${p.name}</b><br>$${p.price}</div><button class="btn-icon" onclick="openProdEdit(${p.id})"><i class="fas fa-pen"></i></button><button class="btn-icon" onclick="deleteProd(${p.id})"><i class="fas fa-trash"></i></button></div>`;
            });
        }
        function toggleProd(id) { const p=db.products.find(x=>x.id===id); p.selected=!p.selected; saveDB(); renderEventSetup(); }
        function launchEventPOS() {
            const e=document.getElementById('evName').value, b=document.getElementById('evBox').value;
            if(!e || !b) return toast("Faltan datos");
            app.activeSession = {event:e, box:b, cash:0, trans:0, debit:0, dateStart:getNow()}; app.cart={};
            saveSession(); document.getElementById('posTitleEv').innerText=e.toUpperCase(); renderEventPOSGrid(); updateUICommon(); showView('v-event-pos');
        }
        function renderEventPOSGrid(f="") {
            const g=document.getElementById('evPosGrid'); g.innerHTML='';
            db.products.filter(p=>p.selected && p.name.toLowerCase().includes(f.toLowerCase())).forEach(p=>{
                g.innerHTML += `<div class="prod-card" onclick="addToCart(${p.id})"><div id="badge-ev-${p.id}" class="prod-badge" style="display:none">0</div><div class="prod-info"><b>${p.name}</b><br>$${p.price}</div></div>`;
            });
        }
        function addToCart(id) { if(!app.cart[id]){const p=db.products.find(x=>x.id===id); app.cart[id]={...p, qty:1};} else app.cart[id].qty++; updateUICommon(); }
        function removeFromCart(id) { if(app.cart[id]){app.cart[id].qty--; if(app.cart[id].qty<=0) delete app.cart[id]; updateUICommon(); openEventCart();} }
        function updateUICommon() {
            let t=0; document.querySelectorAll('.prod-badge').forEach(b=>b.style.display='none');
            for(let id in app.cart){ t+=app.cart[id].price*app.cart[id].qty; const b=document.getElementById('badge-ev-'+id); if(b){b.innerText=app.cart[id].qty; b.style.display='block';} }
            document.getElementById('btnEvCartTotal').innerText = '$'+t;
            if(app.activeSession){ const s=app.activeSession; document.getElementById('posSessionTotal').innerText='$'+(s.cash+s.trans+s.debit); saveSession(); }
        }
        function openEventCart() {
            const l=document.getElementById('cartList'); l.innerHTML=''; let t=0;
            for(let id in app.cart){ const i=app.cart[id]; t+=i.price*i.qty; l.innerHTML+=`<div style="display:flex; justify-content:space-between; margin-bottom:10px;"><span>${i.qty}x ${i.name}</span><b>$${i.price*i.qty} <i class="fas fa-minus-circle" onclick="removeFromCart(${id})"></i></b></div>`; }
            document.getElementById('cartTotalDisplay').innerText='$'+t; document.getElementById('modalCart').style.display='flex';
        }
        function payEvent(m) {
            let t=0; for(let id in app.cart) t+=app.cart[id].price*app.cart[id].qty; if(t===0) return;
            if(m==='Efectivo') app.activeSession.cash+=t; else if(m==='Transferencia') app.activeSession.trans+=t; else app.activeSession.debit+=t;
            app.cart={}; updateUICommon(); closeModal('modalCart'); toast("Cobrado");
        }
        function confirmCloseBox() {
            showConfirm("¿Cerrar caja?", ()=>{
                const s=app.activeSession, t=s.cash+s.trans+s.debit;
                db.eventHistory.push({...s, total:t, id:Date.now(), date:getNow()});
                saveDB(); clearSession();
                document.getElementById('repBody').innerHTML = `<b>${s.event}</b><br>Total: $${t}`;
                prepareTicket(s.event, s.box, getNow(), s.cash, s.trans, s.debit, t);
                document.getElementById('modalReport').style.display='flex';
            });
        }
        function prepareTicket(ev, box, date, c, t, d, total) {
            document.getElementById('tTitle').innerText = ev; document.getElementById('tSub').innerText = box; document.getElementById('tDate').innerText = date;
            document.getElementById('tItems').innerHTML = `Efectivo: $${c}<br>Trans: $${t}<br>Deb: $${d}`;
            document.getElementById('tTotal').innerText = '$'+total;
        }
        function downloadTicketImage() { html2canvas(document.getElementById('ticket-print')).then(c => { const a=document.createElement('a'); a.download=`Cierre.png`; a.href=c.toDataURL(); a.click(); }); }
        function deleteHist(id) { db.eventHistory = db.eventHistory.filter(x=>x.id!==id); saveDB(); renderEventDash(); calcFinancials(); }
        function openProdEdit(id) {
            editId=id; if(id!==-1){const p=db.products.find(x=>x.id===id); document.getElementById('editName').value=p.name; document.getElementById('editPrice').value=p.price;}
            else{document.getElementById('editName').value=''; document.getElementById('editPrice').value='';}
            document.getElementById('modalEdit').style.display='flex';
        }
        function saveProduct() {
            const n=document.getElementById('editName').value, p=parseInt(document.getElementById('editPrice').value);
            if(!n || !p) return;
            if(editId===-1) db.products.push({id:Date.now(), name:n, price:p, selected:true});
            else { const x=db.products.find(z=>z.id===editId); x.name=n; x.price=p; }
            saveDB(); closeModal('modalEdit'); renderEventSetup();
        }
        function deleteProd(id) { db.products = db.products.filter(x=>x.id!==id); saveDB(); renderEventSetup(); }

        // SERVICE WORKER PARA INSTALACIÓN PRO

        }
    </script>
